import { Route, Routes } from 'react-router-dom'
import Home from './pages/home'
import Admin from './pages/admin'

function App() {
  return (
    <div className="App">
      {/* <Home/> */}
      {/* <Admin/> */}

      <Routes>
        <Route  path='/' element={<Home/>}/>
        <Route path='/admin' element={<Admin/>}/>
      </Routes>
    </div>
  );
}

export default App;
